import React from 'react';
import './App.css';
import MissingObject from './Resources/Components/MissingObject';
import SportsEquipment from './Resources/Components/SportsEquipment';
import MissingObjectList from './Resources/Components/MissingObjectList';
import SportsEquipmentList from './Resources/Components/SportsEquipmentList';

function App() {
 
  const sobject= [
    {name: "Balon Futbol", available: false , 
    by: "Encargado deportes", borrowed: true, 
    student_name: "Daniel"}
  ]

  const object = [
    {name: "Calculadora", 
    lugar: "Biblioteca",
    encontrado_por: "Luis"}
  ]
  return (
    <div className="App">
      <SportsEquipment sobject={sobject}></SportsEquipment>
      <MissingObject object={object}/>
    </div>
  );
}

export default App;
